ss.set(function(out){
    function SelTool(obj){
        this.sourceObj = obj;
        this.domWrap = {};//dom存储容器
        this.scope = {};//数据存储容器
        this.init();//初始化
    };
    SelTool.prototype = {
        constructor:SelTool,//构造函数
        //初始化
        init:function(){
            var self = this,obj = self.sourceObj;
            self.lg_pinyin_dict_firstletter();//首字母处理函数加载
            self.lg_pfWrapFn();//数据首字母库
            self['scope']['defaultArr'] = obj.defaultArr ? self.lg_transNumFn(obj.defaultArr) : [];//默认项(同时为选中容器)
            self['scope']['curPage'] = 1;//当前页数
            self['scope']['pageSize'] = obj.pageSize;
            self.rd_layout();//布局
            self.lg_dpDataByPage();//分页处理数据
            self.rd_renderItem();//渲染各项
        },
        //----| 渲染 |----
        //整体布局
        rd_layout:function(){
            var self = this,obj = self.sourceObj;
            ss.crtDom('div','selUserWrap','',obj.el)
            .appendDom(function(dom){
                //检索条
                var searchInput = ss.crtDom('input','searchInput','',dom,{
                    cn:['width','height','lineHeight','border','boxSizing','paddingLeft'],
                    cv:['148px','32px','32px','1px solid #ccc','border-box','10px'],
                    an:['placeholder'],
                    av:['请输入检索']
                },[
                    'input',function(dom){
                        self.lg_inputFn(dom.value);
                    }
                ]);
                self['domWrap']['searchInput'] = searchInput;
                //内容容器
                ss.crtDom('div','conWrap','',dom,{
                    cn:['border','padding','marginTop'],
                    cv:['1px solid #ccc','10px','10px']
                })
                .appendDom(function(dom){
                    //各项容器
                    var itemsWrap = ss.crtDom('div','itemsWrap','',dom,{
                        cn:['height'],
                        cv:['315px']
                    });
                    self['domWrap']['itemsWrap'] = itemsWrap;
                    //信息容器
                    var infoWrap = ss.crtDom('div','infoWrap','',dom,{
                        cn:['position','height'],
                        cv:['relative','40px']
                    })
                    .appendDom(function(dom){
                        //选中提示
                        ss.crtDom('div','selTip','',dom,{
                            cn:['position','bottom','left'],
                            cv:['absolute','10px','0px']
                        })
                        .appendDom(function(dom){
                            var showSel = ss.crtDom('span','','',dom,{
                                cn:['color','fontSize'],
                                cv:['#426fee','16px']
                            });
                            self['domWrap']['showSel'] = showSel;
                            ss.crtDom('span','','项已选中 | ',dom,{
                                cn:['fontSize'],
                                cv:['14px']
                            });                    
                            var showPage = ss.crtDom('span','showPage','1/6页',dom,{
                                cn:['fontSize'],
                                cv:['14px']
                            }); 
                            self['domWrap']['showPage'] = showPage;
                        });
                        //上下页|全选|反选
                        ss.crtDom('div','btnWrap','',dom,{
                            cn:['position','top','right','transform'],
                            cv:['absolute','50%','0px','translateY(-50%)']
                        })
                        .appendDom(function(dom){
                            var commonBtnCss = {
                                cn:[
                                    'backgroundColor','border','display','verticalAlign',
                                    'padding','fontSize','marginLeft','cursor','userSelect','borderRadius'
                                ],
                                cv:[
                                    '#ffffff ',' 1px solid #ccc','inline-block','top',
                                    '2px 6px','14px','10px','pointer','none','3px'
                                ]
                            }
                            //上一页
                            ss.crtDom('div','preBtn','上一页',dom,commonBtnCss,[
                                'click',function(dom){
                                    self.lg_preCliFn();
                                }
                            ]);
                            //下一页
                            ss.crtDom('div','preBtn','下一页',dom,commonBtnCss,[
                                'click',function(dom){
                                    self.lg_nextCliFn();
                                }
                            ]);
                            //全选
                            ss.crtDom('div','preBtn','全选',dom,commonBtnCss,[
                                'click',function(dom){
                                    self.lg_allSelFn(dom);
                                }
                            ]);
                            //反选
                            ss.crtDom('div','preBtn','反选',dom,commonBtnCss,[
                                'click',function(dom){
                                    self.lg_reversedSelFn(dom);
                                }
                            ]);
                        })
                    })
                });

            })  
        },
        //各项渲染
        rd_renderItem:function(){
            var self = this,obj = self.sourceObj;
            self.rd_updateCurData();//获取最新的当前数据
            self.rd_updateInfo();//更新信息栏显示
            var endArr = self.scope['endArr'];
            if(endArr.length!=0){
                var fragment = document.createDocumentFragment();
                for(var a=0; a<endArr.length; a++){
                    var curLi = ss.crtDom('div','item',endArr[a]['name'],fragment,{
                        cn:[
                            'width','display','verticalAlign','height','lineHeight','border','textAlign',
                            'marginLeft','marginBottom','cursor'
                        ],
                        cv:[
                            '31%','inline-block','top','35px','35px','1px solid #ccc','center',
                            a%3==0?'0%':'2.9%','10px','pointer'
                        ],
                        an:['val_id'],
                        av:[endArr[a]['id']]
                    },[
                        'click',function(dom){
                            var selArr = self['scope']['defaultArr'];
                            var curId = Number(dom.getAttribute('val_id'));
                            if(selArr.indexOf(curId)!=-1){
                                //已选中
                                selArr.splice(selArr.indexOf(curId),1);
                                ss.mdfCss(dom,[
                                    'color','#000','backgroundColor','#fff'
                                ])
                            }
                            else{
                                //未选中
                                selArr.push(curId);
                                ss.mdfCss(dom,[
                                    'color','#ffffff','backgroundColor','#39b54a '
                                ])
                            };
                            self.rd_updateInfo();
                        }
                    ]);
                    //是否满足选中资格
                    self['scope']['defaultArr'].indexOf(Number(endArr[a]['id']))!=-1
                    &&(
                        ss.mdfCss(curLi,[
                            'color','#ffffff','backgroundColor','#39b54a '
                        ])
                    );
                };
                self['domWrap']['itemsWrap'].innerHTML = '';
                self['domWrap']['itemsWrap'].appendChild(fragment);
            }
            else{
                self['domWrap']['itemsWrap'].innerHTML = '暂无数据';
            }

        },
        //更新信息栏情况
        rd_updateInfo:function(){
            var self = this,obj = self.sourceObj;
            //选中情况
            self['domWrap']['showSel'].innerHTML = self['scope']['defaultArr'].length;
            //页数
            self['domWrap']['showPage'].innerHTML = 
            self['scope']['curPage']
            +'/'
            +self['scope']['pageCount']
            +'页';  
        },
        //更新当前渲染数据情况
        rd_updateCurData:function(){
            var self = this,obj = self.sourceObj;
            var pageSize = Number(self['scope']['pageSize']) || 21,
            pfWrap = self.scope['pfWrap'],
            curPage = self.scope.curPage;
            var endArr = pfWrap.slice(pageSize*(curPage-1),pageSize*(curPage));
            self.scope['endArr'] = endArr;//最后渲染数据
        },
        //----| 逻辑 |----
        //数据->分页处理后的数据
        lg_dpDataByPage:function(){
            var self = this,obj = self.sourceObj;
            var pageSize = Number(self['scope']['pageSize']),
                pfWrap = self.scope['pfWrap'],
                curPage = self.scope.curPage;
            //当前数据的总页数
            var pageCount = 
                pfWrap.length%pageSize == 0
                    ?
                pfWrap.length%pageSize
                    :
                parseInt(pfWrap.length/pageSize)  + 1;
            self.scope['pageCount'] = pageCount;//总页数
            self.rd_updateInfo();//更新信息栏
        },
        //上一页点击函数
        lg_preCliFn:function(){
            var self = this,obj = self.sourceObj;
            if(self.scope.curPage==1){
                return;
            };
            self.scope.curPage = Number(self.scope.curPage)-1;//重置页数
            self.rd_renderItem();//渲染
        },
        //下一页点击函数
        lg_nextCliFn:function(){
            var self = this,obj = self.sourceObj;
            if(self.scope.curPage==self.scope['pageCount']){
                return;
            };
            self.scope.curPage = Number(self.scope.curPage)+1;//重置页数
            self.rd_renderItem();//渲染
        },
        //全选点击函数
        lg_allSelFn:function(dom){
            var self = this,obj = self.sourceObj;
            var selArr = self['scope']['defaultArr'];
            var items = self['domWrap']['itemsWrap'].children;
            for(var b=0; b<items.length; b++){
                var curId = Number(items[b].getAttribute('val_id'));
                selArr.indexOf(curId)==-1 && (
                    selArr.push(curId),
                    ss.mdfCss(items[b],[
                        'color','#ffffff','backgroundColor','#39b54a '
                    ])
                )
            };
            self.rd_updateInfo();
        },
        //反选点击函数
        lg_reversedSelFn:function(dom){
            var self = this,obj = self.sourceObj;
            var selArr = self['scope']['defaultArr'];
            var items = self['domWrap']['itemsWrap'].children;
            for(var b=0; b<items.length; b++){
                var curId = Number(items[b].getAttribute('val_id'));
                selArr.indexOf(curId)!=-1
                    ?
                (
                    selArr.splice(selArr.indexOf(curId),1),
                    ss.mdfCss(items[b],[
                        'color','#000','backgroundColor','#fff'
                    ])
                )
                    :
                (
                    selArr.push(curId),
                    ss.mdfCss(items[b],[
                        'color','#ffffff','backgroundColor','#39b54a '
                    ])
                )
            };
            self.rd_updateInfo();
        },
        //首字母处理函数
        lg_pinyin_dict_firstletter:function(){
            var self = this;
            //拼音首字母字典文件
            var pinyin_dict_firstletter= {};
            pinyin_dict_firstletter.all = "";
            pinyin_dict_firstletter.polyphone = {"19969":"DZ","19975":"WM","19988":"QJ","20048":"YL","20056":"SC","20060":"NM","20094":"QG","20127":"QJ","20167":"QC","20193":"YG","20250":"KH","20256":"ZC","20282":"SC","20285":"QJG","20291":"TD","20314":"YD","20340":"NE","20375":"TD","20389":"YJ","20391":"CZ","20415":"PB","20446":"YS","20447":"SQ","20504":"TC","20608":"KG","20854":"QJ","20857":"ZC","20911":"PF","20504":"TC","20608":"KG","20854":"QJ","20857":"ZC","20911":"PF","20985":"AW","21032":"PB","21048":"XQ","21049":"SC","21089":"YS","21119":"JC","21242":"SB","21273":"SC","21305":"YP","21306":"QO","21330":"ZC","21333":"SDC","21345":"QK","21378":"CA","21397":"SC","21414":"XS","21442":"SC","21477":"JG","21480":"TD","21484":"ZS","21494":"YX","21505":"YX","21512":"HG","21523":"XH","21537":"PB","21542":"PF","21549":"KH","21571":"E","21574":"DA","21588":"TD","21589":"O","21618":"ZC","21621":"KHA","21632":"ZJ","21654":"KG","21679":"LKG","21683":"KH","21710":"A","21719":"YH","21734":"WOE","21769":"A","21780":"WN","21804":"XH","21834":"A","21899":"ZD","21903":"RN","21908":"WO","21939":"ZC","21956":"SA","21964":"YA","21970":"TD","22003":"A","22031":"JG","22040":"XS","22060":"ZC","22066":"ZC","22079":"MH","22129":"XJ","22179":"XA","22237":"NJ","22244":"TD","22280":"JQ","22300":"YH","22313":"XW","22331":"YQ","22343":"YJ","22351":"PH","22395":"DC","22412":"TD","22484":"PB","22500":"PB","22534":"ZD","22549":"DH","22561":"PB","22612":"TD","22771":"KQ","22831":"HB","22841":"JG","22855":"QJ","22865":"XQ","23013":"ML","23081":"WM","23487":"SX","23558":"QJ","23561":"YW","23586":"YW","23614":"YW","23615":"SN","23631":"PB","23646":"ZS","23663":"ZT","23673":"YG","23762":"TD","23769":"ZS","23780":"QJ","23884":"QK","24055":"XH","24113":"DC","24162":"ZC","24191":"GA","24273":"QJ","24324":"NL","24377":"TD","24378":"QJ","24439":"PF","24554":"ZS","24683":"TD","24694":"WE","24733":"LK","24925":"TN","25094":"ZG","25100":"XQ","25103":"XH","25153":"PB","25170":"PB","25179":"KG","25203":"PB","25240":"ZS","25282":"FB","25303":"NA","25324":"KG","25341":"ZY","25373":"WZ","25375":"XJ","25384":"A","25457":"A","25528":"SD","25530":"SC","25552":"TD","25774":"ZC","25874":"ZC","26044":"YW","26080":"WM","26292":"PB","26333":"PB","26355":"ZY","26366":"CZ","26397":"ZC","26399":"QJ","26415":"ZS","26451":"SB","26526":"ZC","26552":"JG","26561":"TD","26588":"JG","26597":"CZ","26629":"ZS","26638":"YL","26646":"XQ","26653":"KG","26657":"XJ","26727":"HG","26894":"ZC","26937":"ZS","26946":"ZC","26999":"KJ","27099":"KJ","27449":"YQ","27481":"XS","27542":"ZS","27663":"ZS","27748":"TS","27784":"SC","27788":"ZD","27795":"TD","27812":"O","27850":"PB","27852":"MB","27895":"SL","27898":"PL","27973":"QJ","27981":"KH","27986":"HX","27994":"XJ","28044":"YC","28065":"WG","28177":"SM","28267":"QJ","28291":"KH","28337":"ZQ","28463":"TL","28548":"DC","28601":"TD","28689":"PB","28805":"JG","28820":"QG","28846":"PB","28952":"TD","28975":"ZC","29100":"A","29325":"QJ","29575":"SL","29602":"FB","30010":"TD","30044":"CX","30058":"PF","30091":"YSP","30111":"YN","30229":"XJ","30427":"SC","30465":"SX","30631":"YQ","30655":"QJ","30684":"QJG","30707":"SD","30729":"XH","30796":"LG","30917":"PB","31074":"NM","31085":"JZ","31109":"SC","31181":"ZC","31192":"MLB","31293":"JQ","31400":"YX","31584":"YJ","31896":"ZN","31909":"ZY","31995":"XJ","32321":"PF","32327":"ZY","32418":"HG","32420":"XQ","32421":"HG","32438":"LG","32473":"GJ","32488":"TD","32521":"QJ","32527":"PB","32562":"ZSQ","32564":"JZ","32735":"ZD","32793":"PB","33071":"PF","33098":"XL","33100":"YA","33152":"PB","33261":"CX","33324":"BP","33333":"TD","33406":"YA","33426":"WM","33432":"PB","33445":"JG","33486":"ZN","33493":"TS","33507":"QJ","33540":"QJ","33544":"ZC","33564":"XQ","33617":"YT","33632":"QJ","33636":"XH","33637":"YX","33694":"WG","33705":"PF","33728":"YW","33882":"SR","34067":"WM","34074":"YW","34121":"QJ","34255":"ZC","34259":"XL","34425":"JH","34430":"XH","34485":"KH","34503":"YS","34532":"HG","34552":"XS","34558":"YE","34593":"ZL","34660":"YQ","34892":"XH","34928":"SC","34999":"QJ","35048":"PB","35059":"SC","35098":"ZC","35203":"TQ","35265":"JX","35299":"JX","35782":"SZ","35828":"YS","35830":"E","35843":"TD","35895":"YG","35977":"MH","36158":"JG","36228":"QJ","36426":"XQ","36466":"DC","36710":"JC","36711":"ZYG","36767":"PB","36866":"SK","36951":"YW","37034":"YX","37063":"XH","37218":"ZC","37325":"ZC","38063":"PB","38079":"TD","38085":"QY","38107":"DC","38116":"TD","38123":"YD","38224":"HG","38241":"XTC","38271":"ZC","38415":"YE","38426":"KH","38461":"YD","38463":"AE","38466":"PB","38477":"XJ","38518":"YT","38551":"WK","38585":"ZC","38704":"XS","38739":"LJ","38761":"GJ","38808":"SQ","39048":"JG","39049":"XJ","39052":"HG","39076":"CZ","39271":"XT","39534":"TD","39552":"TD","39584":"PB","39647":"SB","39730":"LG","39748":"TPB","40109":"ZQ","40479":"ND","40516":"HG","40536":"HG","40583":"QJ","40765":"YQ","40784":"QJ","40840":"YK","40863":"QJG"};
            var dict = {firstletter : pinyin_dict_firstletter}; // 存储所有字典数据
            var pinyinUtil = {
                getFirstLetter: function(str, polyphone) {
                    polyphone = polyphone == undefined ? false : polyphone;
                    if(!str || /^ +$/g.test(str)) return '';
                    if(dict.firstletter){ // 使用首字母字典文件
                        var result = [];
                        for(var i=0; i<str.length; i++)
                        {
                            var unicode = str.charCodeAt(i);
                            var ch = str.charAt(i);
                            if(unicode >= 19968 && unicode <= 40869)
                            {
                                ch = dict.firstletter.all.charAt(unicode-19968);
                                if(polyphone) ch = dict.firstletter.polyphone[unicode] || ch;
                            }
                            result.push(ch);
                        }
                        if(!polyphone) return result.join(''); // 如果不用管多音字，直接将数组拼接成字符串
                        else return handlePolyphone(result, '', ''); // 处理多音字，此时的result类似于：['D', 'ZC', 'F']
                    }
                    else
                    {
                        var py = this.getPinyin(str, ' ', false, polyphone);
                        py = py instanceof Array ? py : [py];
                        var result = [];
                        for(var i=0; i<py.length; i++)
                        {
                            result.push(py[i].replace(/(^| )(\w)\w*/g, function(m,$1,$2){return $2.toUpperCase();}));
                        }
                        if(!polyphone) return result[0];
                        else return simpleUnique(result);
                    }
                },
            };
            function handlePolyphone(array, splitter, joinChar) {
                splitter = splitter || '';
                var result = [''], temp = [];
                for(var i=0; i<array.length; i++)
                {
                    temp = [];
                    var t = array[i].split(splitter);
                    for(var j=0; j<t.length; j++)
                    {
                        for(var k=0; k<result.length; k++)
                            temp.push(result[k] + (result[k]?joinChar:'') + t[j]);
                    }
                    result = temp;
                }
                return simpleUnique(result);
            }
            // 简单数组去重
            function simpleUnique(array) {
                var result = [];
                var hash = {};
                for(var i=0; i<array.length; i++)
                {
                    var key = (typeof array[i]) + array[i];
                    if(!hash[key])
                    {
                        result.push(array[i]);
                        hash[key] = true;
                    }
                }
                return result;
            }
            pinyinUtil.dict = dict;
            self['scope']['pinyinUtil'] = pinyinUtil;
        },
        //数据首字母库
        lg_pfWrapFn:function(){
            var self = this,obj = self.sourceObj;
            var relyData = obj.data;
            for(var a=0; a<relyData.length; a++){
                relyData[a]['pf'] = self['scope']['pinyinUtil'].getFirstLetter(relyData[a].name);
            };
            self.scope['pfWrap'] = relyData;
            self.scope['sourceDataWrap'] = relyData;//原始总数据
        },
        //处理输入后
        lg_inputFn:function(val){
            var self = this,obj = self.sourceObj;
            var pfData = self.scope['sourceDataWrap'];
            var endData = [];
            //字母
            val ?
            //不为空
            (function(){
                //为字母
                if(/[a-zA-Z]{1,}/.test(val)){
                	console.log('字母')
                    for(var a=0; a<pfData.length; a++){
                        ( 
                        	pfData[a].pf.indexOf(val.toUpperCase())!=-1 
                        	||
                        	pfData[a].pf.indexOf(val)!=-1 
                		) 
                        && (endData.push(pfData[a]));
                    };
                }
                //为非字母
                else{
                    for(var a=0; a<pfData.length; a++){
                        pfData[a].name.indexOf(val)!=-1 && (endData.push(pfData[a]));
                    };
                }
            }())
                :
            //为空
            (endData =  self.scope['sourceDataWrap']);
            self.scope['pfWrap'] = endData;
            self.scope.curPage = 1;//处理数据前->重置页数为1
            self.lg_dpDataByPage();//分页处理数据
            self.rd_renderItem();//渲染各项
        },
        //根据id转换为名称
        lg_transNameFn:function(arr){
            var sourceData = this.scope.sourceDataWrap;
            var idData = this.scope.defaultArr;
            //id哈希表
            var idHashObj = {}
            idData.forEach(function(item){
                idHashObj[item] = true
            });
            var endNameArr = []
            sourceData.forEach(function(item){
                idHashObj[item.id] && endNameArr.push(item.name)
            });
            return endNameArr
        },
        //将默认值的字符串转换为数字
        lg_transNumFn:function(arr){
            var endArr = [];
            arr.forEach(function(item){
                endArr.push(Number(item))
            });
            return endArr
        }
    };
    out('selTool',function(obj){
        return new SelTool(obj);
    });
})  





















